const serviceEndpoint = 'http://127.0.0.1:5000';

export const addNumber = async (numberToAdd) => {
    const response = await fetch(
      `${serviceEndpoint}/add`,

      {
        headers: {
            'content-type': 'application/json'
        },
        method: 'POST',
        body: JSON.stringify({
            number: 22
        })
      }
    )
    .then((response) => response.json()).then(console.log);
}
